import { Nav } from "./Nav"
import { Header } from "./Header"
import { Educationals } from "./Educationals"
import { PersonalInfo } from "./PersonalInfo"
// import { Contact } from "./Contact"
import { Projects } from "./Projects"
// import { LandingPage } from "./LandingPage"
// import { Footer } from "./Footer"

import reactLogo from "./img/logo512.png"
import React from "react"

function App() {

  const techArray = []

  const createTechInfoObj = (techId, techName, techDescription, techUrl, techImg, techAlt) => ({
    id: techId,
    name: techName,
    description: techDescription,
    url: techUrl,
    img: techImg,
    alt: techAlt
})

const react = createTechInfoObj("react", "React.js", "tech description", "", reactLogo, "React.js Logo")
techArray.push(react)

const javascript = createTechInfoObj("javascript", "Javascript", "tech description", "", reactLogo, "javascript Logo")
techArray.push(javascript)

const html5 = createTechInfoObj("html5", "HTML5", "tech description", "", reactLogo, "HTML5 Logo")
techArray.push(html5)

const css3 = createTechInfoObj("css3", "CSS3", "tech description", "", reactLogo, "CSS3 Logo")
techArray.push(css3)

const gitandgithub = createTechInfoObj("github" ,"Git & Github", "tech description", "", reactLogo, "Git & Github Logo")
techArray.push(gitandgithub)

let slidesArray = techArray.slice(displayedSlidesStart, displayedSlidesEnd)

const [techDisplay, setTechDisplay] = useState(slidesArray)

  return ([
    <Nav />,
    <Header />,
    <PersonalInfo />,
    <Educationals techArray={techArray}/>,
    <Projects />,
    /*
    <Contact />,

    <LandingPage />,
    <Footer />,*/
    ])
}

export { App }
